hoice 1.1\",\"metadata\":{\"contentType\":\"Simple Multi Choice\",\"license\":\"U\",\"title\":\"Whats your biggest expectation challenge right now?\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Whats your biggest expectation challenge right now?\"},\"subContentId\":\"e1568543-9691-4966-a240-26dde2b251da\"},\"requiredField\":false},{\"library\":{\"params\":{\"placeholderText\":\"Start writing...\",\"inputRows\":\"1\",\"question\":\"Write ONE sentence for a real HDR task you are working on this week that includes: deliverable + deadline + success criteria. Use this structure: By [date/time], I will deliver [what], covering [scope], to the standard of [criteria].\"},\"library\":\"H5P.OpenEndedQuestion 1.0\",\"metadata\":{\"contentType\":\"Open Ended Question\",\"license\":\"U\",\"title\":\"Write your 1-sentence alignment statement\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Write your 1-sentence alignment statement\"},\"subContentId\":\"025a6ff4-b9fa-4688-9c33-9bdc242bd2b8\"},\"requiredField\":true},{\"library\":{\"params\":{\"inputType\":\"checkbox\",\"alternatives\":[{\"feedback\":{\"chosenFeedback\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"I will confirm the deliverable (format/length) and what done looks like.\"},{\"feedback\":{\"chosenFeedback\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"I will confirm scope: whats in/out and the expected depth.\"},{\"feedback\":{\"chosenFeedback\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"I will ask for success criteria or an example standard if feedback is vague.\"},{\"feedback\":{\"chosenFeedback\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"I will propose a timeline and a check-in cadence for longer tasks.\"},{\"feedback\":{\"chosenFeedback\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"I will send a short written recap (goal, deliverable, deadline, owner, risks/dependencies).\"},{\"feedback\":{\"chosenFeedback\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"I will surface constraints early and ask the supervisor to prioritise trade-offs.\"}],\"question\":\"Which actions will you use in your next supervisor interaction? (Select all that apply)\"},\"library\":\"H5P.SimpleMultiChoice 1.1\",\"metadata\":{\"contentType\":\"Simple Multi Choice\",\"license\":\"U\",\"title\":\"Commit to actions\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Commit to actions\"},\"subContentId\":\"28aad06d-444b-4e07-976c-140316765b43\"},\"requiredField\":true},{\"library\":{\"params\":{\"inputRows\":\"1\",\"question\":\"Draft a short recap message you could send after a meeting (6 lines max). Keep it specific and measurable. Example: Goal: Align literature review focus for Chapter 2 Deliverable: 2-page synthesis + methods table Deadline: Tue 18 Feb 5pm Criteria:\",\"placeholderText\":\"Start writing...\"},\"library\":\"H5P.OpenEndedQuestion 1.0\",\"metadata\":{\"contentType\":\"Open Ended Question\",\"license\":\"U\",\"title\":\"Draft your 6-line recap\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Draft your 6-line recap\"},\"subContentId\":\"46d3804f-aa95-4fb6-a409-09e321373ff3\"},\"requiredField\":true}]}","library":"H5P.Questionnaire 1.3","contentUrl":".","metadata":{"license":"U","title":"Apply it to your current HDR task","defaultLanguage":"en"},"scripts":["/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.SimpleMultiChoice-1.1/dist/dist.js?version=1.1.22","/h5p/libraries/H5P.OpenEndedQuestion-1.0/dist/h5p-open-ended-question.js?version=1.0.28","/h5p/libraries/H5P.Questionnaire-1.3/dist/dist.js?version=1.3.11"],"styles":["/h5p/libraries/H5P.Image-1.1/image.css?version=1.1.22","/h5p/libraries/H5P.SimpleMultiChoice-1.1/dist/styles.css?version=1.1.22","/h5p/libraries/H5P.OpenEndedQuestion-1.0/dist/h5p-open-ended-question.css?version=1.0.28","/h5p/libraries/FontAwesome-4.5/h5p-font-awesome.min.css?version=4.5.4","/h5p/libraries/H5P.Questionnaire-1.3/dist/styles.css?version=1.3.11"],"url":".","exportUrl":"/h5p/download/2327932952"}},"core":{"scripts":["/h5p/core/js/jquery.
